import styled from "styled-components";

const FooterWrapper = styled.footer`
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100vw;
  height: 72px;
  border-top: solid 1px #040234;
`;

const Footer = () => {
  return (
    <FooterWrapper>
      <a>hello</a>
    </FooterWrapper>
  );
};

export default Footer;
